*{margin: 0; padding: 0; font-family: 'Spoqa Han Sans Neo', 'sans-serif';}
a{text-decoration: none; color: black;}
li{list-style: none;}
img{display: block;}

/*-------header---------*/
.popup01 {display: none;}
.header {
    width: 100%; height: 50px;
    position: relative;
}
.logo {
    width: 150px; height: 90%;
    display: inline-block;
    margin-top: 2%;
    margin-left: 1%;
}
.logo img {
    width: 100%; height: auto;
}
.gnb2 {display: none;}
.gnb {
    width: 150px; height: 50px;
    float: right;
    line-height: 50px;
}
.gnb ul li {
    float: left;
    font-size: 25px;
    margin-left: 8%;
}
#search_chk {display: none;}
#search_chk:checked ~ .search_box {height: 45px;}
#search_chk ~ .search_box {height: 0;}

.search_box {
    width: 100%; height: 0;
    overflow: hidden;
    box-sizing: border-box;
    transition: all .3s ease;
    position: absolute;
    top: 50px; left: 0;
    text-align: center;
    line-height: 40px;
    z-index: 99;
    background-color: white;
}
#search { 
    width: 80%; height: 60%;
    outline: none;
    border:0;
    border-bottom: 1px solid black;
}
.search_btn {
    width: 40px; height: 25px;
    background-color: white;
    border: 1px solid black;
    border-radius: 3px;
}
#lnb {display: none;}
#lnb:checked ~ .lnb_sheet {
    right: 0;
    display: block;
}
#lnb:checked ~ .lnb_open {display: none;}
#lnb:checked ~ .lnb_close {display: block;}
#lnb ~ .lnb_sheet {right: -105%;}
#lnb ~ .lnb_open {display: block;}
#lnb ~ .lnb_close {display: none;}
.lnb2, .lnb2_sheet{display: none;}
.lnb_sheet {
    display: none;
    width: 100vw; height: 100vh;
    position: absolute;
    top: 0; right: -105%;
    background-color:white;
    z-index: 98;
}
.lnb_close {
    position: absolute;
    top: 0; right: 10px;
    z-index: 99;
}
.sub_menu {
    margin-top: 10px;
    width: 100%; height: 35px;
    line-height: 35px;
}
.sub_menu ul li {
    width: 25%; height: 35px;
    display: inline-block;
    font-size: 18px;
    text-align: center;
    border-top: 1px solid #ccc;
    border-bottom: 1px solid #ccc;
    border-left: 1px solid #ccc;
    margin: 0;
    box-sizing: border-box;
}
.sub_menu ul li:first-child {border-left: 0;}
.sub_box {
    width: 100%; height: 35px;
}
.sub_menu2, .sub_menu3 {
    width: 50%; height: 35px;
    float: left;
    text-align: center;
    font-size: 18px;
    line-height: 35px;
    border-bottom: 1px solid #ccc;
    box-sizing: border-box;
}
.sub_menu3 {
    border-left: 1px solid #ccc;
}
.sub_menu3 ul li{
    display: inline-block;
    text-align: center;
    width: 32%;
    margin: 0;
} 
#chk01, #chk02, #chk03, #chk04, #chk05, #chk06, #chk07 {display: none;}
#chk01:checked ~ .chk_sheet01 {display: block;}
#chk01:checked ~ .sub_open {display: none;}
#chk01:checked ~ .sub_close {display: block;}
#chk01 ~ .sub_open {display: block;}
#chk01 ~ .sub_close {display: none;}

#chk02:checked ~ .chk_sheet02 {display: block;}
#chk02:checked ~ .sub_open2 {display: none;}
#chk02:checked ~ .sub_close2 {display: block;}
#chk02 ~ .sub_open2 {display: block;}
#chk02 ~ .sub_close2 {display: none;}

#chk03:checked ~ .chk_sheet03 {display: block;}
#chk03:checked ~ .sub_open3 {display: none;}
#chk03:checked ~ .sub_close3 {display: block;}
#chk03 ~ .sub_open3 {display: block;}
#chk03 ~ .sub_close3 {display: none;}

#chk04:checked ~ .chk_sheet04 {display: block;}
#chk04:checked ~ .sub_open4 {display: none;}
#chk04:checked ~ .sub_close4 {display: block;}
#chk04 ~ .sub_open4 {display: block;}
#chk04 ~ .sub_close4 {display: none;}

#chk05:checked ~ .chk_sheet05 {display: block;}
#chk05:checked ~ .sub_open5 {display: none;}
#chk05:checked ~ .sub_close5 {display: block;}
#chk05 ~ .sub_open5 {display: block;}
#chk05 ~ .sub_close5 {display: none;}

#chk06:checked ~ .chk_sheet06 {display: block;}
#chk06:checked ~ .sub_open6 {display: none;}
#chk06:checked ~ .sub_close6 {display: block;}
#chk06 ~ .sub_open6 {display: block;}
#chk06 ~ .sub_close6 {display: none;}

#chk07:checked ~ .chk_sheet07 {display: block;}
#chk07:checked ~ .sub_open7 {display: none;}
#chk07:checked ~ .sub_close7 {display: block;}
#chk07 ~ .sub_open7 {display: block;}
#chk07 ~ .sub_close7 {display: none;}

.sub_box2 {
    width: 100%;
    float: left;
}
.same {
    width: 100%; height: 35px;
    display: inline-block;
    font-size: 20px;
    line-height: 35px;
    margin-bottom: 10px;
}
.same2 {
    width: 100%; height: 35px;
    display: inline-block;
    font-size: 20px;
    line-height: 35px;
    margin-bottom: 10px;
}
.same div:first-child {
    width: 45%;
    float: left;
    margin-left: 5%;
    text-align: left;
}
.same div:last-child {
    width: 45%;
    float: right;
    margin-right: 5%;
    text-align: right;
}
.same2 div:first-child {
    width: 45%;
    float: left;
    margin-left: 5%;
    text-align: left;
}
.same2 div:last-child {
    width: 45%;
    float: right;
    margin-right: 5%;
    text-align: right;
}
.same3{display: none;}
.same3 ul li {
    width: 95%;
    display: inline-block;
    font-size: 16px;
    line-height: 40px;
    text-align: left;
    margin-left: 5%;
}

/*------wrap-------*/

.visual_main {
    width: 100%; height: 280px;
    position: relative;
    overflow: hidden;
}
.thum_box {display: none;}

.slide {
    width: 400%; height: 280px;
    position: absolute;
    top: 0; left: 0;
    transition: left .5s ease-out;
}

.slide li {
    float: left;
    width: 25%; height: 280px;
    cursor: pointer;
}
.slide li img {
    width: 100%;
}

.visual_btn_box span {
    position: absolute;
    top: 45%;
    font-size: 30px;
    width: 40px; height: 40px;
    background-color: rgba(216, 204, 204, 0.624);
    text-align: center;
    line-height: 40px;
    border-radius: 50%;
}
.visual_prev {left: 1%;}
.visual_next {right: 1%;}

.img_bar {
    display: none;
}

/*----------metaphor----------*/

.metaphor {
    width: 85%; height: 300px;
    margin: 100px auto;
    text-align: center;
    display: flex;
    flex-wrap: wrap;
    align-content: space-around;
}
.metaphor li {
    width: 30%; height: 130px;
    margin-left: 2%;
    margin-bottom: 3%;
}
.metaphor li a {
    display: inline-block;
    width: 85px; height: 85px;
    border: 1px solid black;
    box-sizing: border-box;
    border-radius: 50%;
}
.metaphor li a img {
    width: 60%;
    margin: 20% auto;
}


/*---------schedule---------*/
#sche01, #sche02, #sche03, #sche04 {display: none;}
#sche01:checked ~ .sche01_sheet {height: 300px;}
#sche01:checked ~ .sche01_open {display: none;}
#sche01:checked ~ .sche01_close {display: block;}
#sche01 ~ .sche01_open {display: block;}
#sche01 ~ .sche01_close {display: none;}

#sche02:checked ~ .sche02_sheet {height: 300px;}
#sche02:checked ~ .sche02_open {display: none;}
#sche02:checked ~ .sche02_close {display: block;}
#sche02 ~ .sche02_open {display: block;}
#sche02 ~ .sche02_close {display: none;}

#sche03:checked ~ .sche03_sheet {height: 300px;}
#sche03:checked ~ .sche03_open {display: none;}
#sche03:checked ~ .sche03_close {display: block;}
#sche03 ~ .sche03_open {display: block;}
#sche03 ~ .sche03_close {display: none;}

#sche04:checked ~ .sche04_sheet {height: 300px;}
#sche04:checked ~ .sche04_open {display: none;}
#sche04:checked ~ .sche04_close {display: block;}
#sche04 ~ .sche04_open {display: block;}
#sche04 ~ .sche04_close {display: none;}



.title {
    width: 100%;
    text-align: center;
    margin-top: 130px;
    margin-bottom: 50px;
}

.schedule {
    width: 100%; height: 600px;
    margin: 0 auto;
    position: relative;
    overflow: hidden;
}
.schedule_slide {
    width: 400%; 
    position: absolute;
    top: 0; left: 0;
    transition: left .5s ease-out;
} 
.schedule_slide div {
    width: 25%;
    float: left;
}
.date {
    width: 100%; height: 40px;
    background-color: #2e3192;
    text-align: center;
    color: #eee;
    line-height: 40px;
    font-size: 20px;
}
.schedule_btn span {
    position: absolute;
    top: 1px;
    font-size: 25px;
    color: #eee;
}
.sche_prev {left: 1%;}
.sche_next {right: 1%;}

.dule {
    width: 100%; 
}
.dule li {
    width: 80%; height: 35px;
    font-size: 16px;
    margin-left: 15%;
    line-height: 35px;
    margin-top: 2%;
    overflow: hidden;
    text-overflow: ellipsis;
    white-space: nowrap;
}
.dule li span {float: left;}
.dule li p {
    width: 17px; height: 17px;
    float: left;
    margin-top: 12px;
    margin-left: 10px;
    margin-right: 5px;
}

.sche01_sheet, .sche02_sheet, .sche03_sheet, .sche04_sheet {
    width: 100%; height: 0;
    transition: all .2s ease-in-out;
    overflow: hidden;
    background-color: white;
    z-index: 9999;
}
.duleBtn {
    text-align: center;
    font-size: 25px;
    background-color: white;
}




/*---------trailer---------*/

.trailer {
    width: 100%; height: 550px;
    background-color: #caecee;
}
video {
    margin-top: 40px;
}
.trailer div {
    width: 90%;
    margin-left: 10%;
    margin-top: 20px;
}

.trailer p:first-child{
    color: #2e3192;
    font-size: 18px;
}
.trailer p:last-child {font-size: 15px;}
/*---------recommend---------*/
.recommend {
    width: 100%;
    text-align: center;
    overflow: hidden;
}
#reco01, #reco02, #reco03 {display: none;}
#reco01:checked ~ .reco_sheet01 {display: block;}
#reco01:checked ~ section .reco01 {
    background-color: #2e3192;
    color: #eee;
    border: 0;
}
#reco02:checked ~ .reco_sheet02 {display: block;}
#reco02:checked ~ section .reco02 {
    background-color: #2e3192;
    color: #eee;
    border: 0;
}
#reco03:checked ~ .reco_sheet03 {display: block;}
#reco03:checked ~ section .reco03 {
    background-color: #2e3192;
    color: #eee;
    border: 0;
}
.recommend section {margin-top: 15px;}
.reco01, .reco02 {
    margin: 0 auto;
    padding: 2px 19px;
}
.reco03 {
    padding: 2px 7px;
}
.reco01, .reco02, .reco03 {
    margin-left: 10px;
    border: 1px solid #ccc;
    border-radius: 50px;
    background-color: white;
    font-size: 17px;
    text-align: center;
}
.reco_sheet01, .reco_sheet02, .reco_sheet03 {
    display: none;
    width: 100%; height: 400px;
    margin-top: 50px;
    position: relative;
}
.back {
    width: 100%; height: 250px;
    background-color: rgb(184, 174, 174);
    position: absolute;
    top: 0; left: 0;
    z-index: -1;
}
.recoSlide{
    width: 400%; 
    position: absolute;
    top: 0; left: 0;
}
.recoSlide2 {
    width: 100%;
}
.recoSlide div{
    width: 11%; height: 350px;
    float: left;
    margin-top: 5px;
    margin-left: 1%;
}

.reco_title {
    overflow: hidden;
    text-overflow: ellipsis;
    white-space: nowrap;
    margin-bottom: 2%;
    font-weight: bold;
}
.reco_date {
    font-size: 13px;
    margin-bottom: 2%;
}
.recoSlide img{
    width: 100%;
}
.recoSlide button, .recoSlide1 button, .recoSlide2 button {
    font-size: 16px;
    border-radius: 50px;
    margin-top: 30px;
    box-shadow: 3px 3px 3px #ccc;
}
.buy {
    padding: 2px 10px;
    background-color: #2e3192;
    color: #eee;
    border: 0;
}
.more {
    border: 1px solid #eee;
    padding: 2px 3px;
    margin-left: 10px;
}
.reco_btn_box span {
    position: absolute;
    top: 35%;
    font-size: 30px;
    width: 40px; height: 40px;
    border-radius: 50%;
    background-color: rgba(216, 185, 185, 0.438);
}
.reco_prev {left: 1%; display: none;}
.reco_next {right: 1%;}


/*---------critic---------*/
.critic02_box {display: none;}
.cri {
    width: 95%; height: 250px;
    margin: 0 auto;
    border-radius: 10px;
    overflow: hidden;
    border: 1px solid #eee;
    box-shadow: 3px 3px 3px #ccc;
    margin-bottom: 20px;
}
.cri a {
    display: inline-block;
    width: 50%; height: 250px;
    overflow: hidden;
}
.cri a img {
    width: 100%; height: 100%;
}
.critic_detail {
    width: 50%; height: 250px;
    float: right;
}
.critic_title {
    margin-left: 5px;
    margin-top: 5px;
    font-size: 18px;
    margin-bottom: 2px;
    font-weight: bold;
}
.critic_sub {
    font-size: 13px;
    margin-left: 5px;
    margin-right: 5px;
    margin-bottom: 2px;
    font-weight: bold;
}
.critic_de {
    width: 97%; height: 68%;
    margin-left: 5px;
    margin-right: 10px;
    font-size: 14px;
    margin-bottom: 5px;
    overflow: hidden;
}
#cri_chk {display: none;}
#cri_chk:checked ~ .cri_sheet {height: 550px;}
#cri_chk:checked ~ .cri_open {display: none;}
#cri_chk:checked ~ .cri_close {display: block;}
#cri_chk ~ .cri_open {display: block;}
#cri_chk ~ .cri_close {display: none;}

.cri_open, .cri_close {
    width: 75px; height: 30px;
    line-height: 30px;
    margin: 20px auto;
    text-align: center;
    border: 1px solid #ccc;
    border-radius: 50px;
}
.cri_sheet {
    width: 100%; height: 0;
    overflow: hidden;
    transition: all .3s ease-in-out;
    overflow: hidden;
}


/*---------event---------*/
.event {
    width: 100%; height: 150px;
    position: relative;
    overflow: hidden;
}
.eventSlide {
    width: 400%; height: 150px;
    position: absolute;
    top: 0; left: 0;
    transition: left .5s ease-in-out;
}
.eventSlide div {
    width: 25%; 
    float: left;
}
.eventSlide img {width: 100%;}
.event_btn_box span {
    position: absolute;
    top: 45%;
    font-size: 30px;
    width: 40px; height: 40px;
    border-radius: 50%;
    background-color: rgba(77, 65, 65, 0.466); 
    text-align: center;
    line-height: 40px;
}
.event_prev {left: 0;}
.event_next {right: 0;}


/*---------SNS---------*/

.sns{
    width: 100%; height: auto;
}
.sns a {
    position: relative;

}
.sns a img {width: 100%;}
.sns_title {
    position: absolute;
    top: 2%; left: 1%;
    background-color: rgba(216, 204, 204, 0.624);
    font-size: 14px;
    border-radius: 4px;
    padding: 2px 5px;
    z-index: 9;
}

.sns_box {
    width: 100%; 
    display: flex;
    flex-wrap: wrap;
}
.sns_box a:first-child{
    display: inline-block;
    width: 65%;
}
.sns_box a:nth-child(2) {
    display: inline-block;
    width: 35%;
}
.sns_box a:nth-child(3) {
    display: inline-block;
    width: 35%;
}
.sns_box a:nth-child(4) {
    display: inline-block;
    width: 65%;
}
.naver2 {display: none;}
.naver {
    display: inline-block;
    width: 100%;
}
.sns_box02 {
    width: 100%;
    display: flex;
    flex-wrap: wrap;
}
.youtube1 {
    display: inline-block;
    width: 50%;
}
.youtube2 {
    display: inline-block;
    width: 50%;
}



/*--------map----------*/
#map {display: none;}
#map:checked ~ .map_sheet {display: block;}
#map:checked ~ .map_open {display: none;}
#map:checked ~ .map_close {display: block;}
#map ~ .map_sheet {display: none;}
#map ~ .map_open {display: block;}
#map ~ .map_close {display: none;}

.map {

    margin-top: 150px;
}
.map_detail {display: none;}
.map_open, .map_close {
    width: 100%; height: 40px;
    line-height: 40px;
    background-color: #eee;
    font-size: 18px;
}
.map_open span:first-child {
    float: left;
    margin-left: 2%;
}
.map_open span:last-child {
    float: right;
    margin-right: 2%;
}
.map_close span:first-child {
    float: left;
    margin-left: 2%;
}
.map_close span:last-child {
    float: right;
    margin-right: 2%;
}
h4 {
    margin-top: 10px;
    margin-bottom: 5px;
    margin-left: 2%;
}

.map_sheet p {
    margin-left: 2%;
    font-size: 14px;
}


/*---------news---------*/
.news {
    width: 100%; height: 150px;
    margin-top: 50px;
    display: flex;
}
.news01, .news02 {
    width: 49%; height: 150px;
    border: 1px solid #ccc;
    box-sizing: border-box;
    
}
.new h4 span {float: right; margin-right: 2%;}
.news01 {margin-right: 2%;}
.new ul li {
    width: 100%; height: 20px;
    margin-bottom: 5px;
    line-height: 20px;
}
.new ul li span:first-child {
    width: 60%; height: 20px;
    margin-left: 2%;
    margin-right: 5%;
    overflow: hidden;
    white-space: nowrap;
    text-overflow: ellipsis;
    float: left;
    font-size: 12px;
}

.new ul li span:last-child {
    margin-right: 2%;
    font-size: 12px;
}

.news_letter {
    width: 100%; height: 40px;
    line-height: 40px;
    font-size: 18px;
    border-top: 1px solid #ccc;
    border-bottom: 1px solid #ccc;
    margin-top: 50px;
}
.news_letter span {
    margin-left: 2%;
    font-weight: bold;
}
.news_letter button {
    float: right;
    padding: 5px 10px;
    margin-right: 10%;
    margin-top: 5px;
    border: 0;
    border-radius: 50px;
    background-color: #2e3192;
    color: #eee;
}

#footer_lnb {display: none;}
#footer_lnb:checked ~ .footer_lnb_sheet {display: block;}
#footer_lnb:checked ~ .footer_open {display: none;}
#footer_lnb:checked ~ .footer_close {display: block;}
#footer_lnb ~ .footer_lnb_sheet {display: none;}
#footer_lnb ~ .footer_open {display: block;}
#footer_lnb ~ .footer_close {display: none;}

.footer_open, .footer_close {
    width: 100%;  height: 40px;
    line-height: 40px;
    background-color: #eee;
    font-size: 18px;
}
.footer_lnb_sheet {
    width: 100%; height: 65px;
    font-size: 15px;
}
.footer_lnb_sheet li {
    float: left;
    margin-left: 2%;
    margin-top: 2%;
}
.footer_open span:first-child {
    float: left;
    margin-left: 2%;
}
.footer_open span:last-child {
    float: right;
    margin-right: 2%;
}
.footer_close span:first-child {
    float: left;
    margin-left: 2%;
}
.footer_close span:last-child {
    float: right;
    margin-right: 2%;
}

/*---------mecenat---------*/
.roll {
    width: 100%; height: 40px;
    border-top: 1px solid #ccc;
    line-height: 40px;
    overflow: hidden;
}
.roll span:first-child{
    margin-left: 2%;
    width: 40%;
    float: left;
}
.roll span:last-child {
    position: relative;
}
.mecenat_box {
    width: 50%; height: 40px;
    overflow: hidden;
    float: right;
    margin-right: 2%;
}
.roll img {
    width: 100px; height: 40px;
}
.mecenat_slide {
    width: 1100px; height: 40px;
    position: absolute;
    top: 0; left: 0;
    animation: mecenat_slide1 20s infinite linear;
}
@keyframes mecenat_slide1 {
    from {left: 0px;}
    50% {left: -400px;}
    to {left: -800px;}
}
.mecenat_slide li {
    float: left;
    margin-right: 1%;
}
.mecenat_slide2 {
    width: 1000px; height: 40px;
    position: absolute;
    top: 0; left: 0;
    animation: mecenat_slide2 20s infinite linear;
}
@keyframes mecenat_slide2 {
    from {left: 0px;}
    50% {left: -400px;}
    to {left: -800px;}
}
.mecenat_slide2 li {
    float: left;
    margin-right: 1%;
}

.web_mecenat {display: none;}
.footer2 {display: none;}
.quick2 {display: none;}


/*---------footer---------*/


.footer {
    width: 100%; height:250px;
    background-color: #eee;
    border: 1px solid #eee;

}
.footer p {
    width: 95%; height: 150px;
    margin-left: 2%;
    margin-top: 30px;
    font-size: 14px;
}
.footer div {
    width: 100%;
}
.footer div a {
    width: 47%;
    float: left;
    margin-left: 2%;
}
.footer img {
    width: 100%;
}

body {
    width: 100%;
    position: relative;
}
.quick {
    width: 50px; height: 170px;
    position: fixed;
    bottom: 0; right: 3%;
    transition: all .3s linear;
}
.quick a {
    display: inline-block;
